import React from 'react';
import { Feather } from '@expo/vector-icons';
import { useNavigation } from '@react-navigation/native';
import { View, FlatList, Image, Text, TouchableOpacity } from 'react-native';

import styles from './styles';

export default function Detail() {
  const navigation = useNavigation();

  function navigateBack() {
    navigation.goBack()
  }


  return (
    <View style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity onPress={navigateBack}>
          <Feather name='arrow-left-circle' size={28} color='#2AB940' />
        </TouchableOpacity>
      </View>

      <View style={styles.projeto}>
        <Text style={[styles.projetoTipo, { marginTop: 0 }]}>Intituição/Projeto:</Text>
        <Text style={styles.projetoNome}>GPACI</Text>

        <Text style={styles.projetoTipo}>Atividade:</Text>
        <Text style={styles.projetoNome}>Aulas de música</Text>

        <Text style={styles.projetoTipo}>Descrição:</Text>
        <Text style={styles.projetoNome}>Realizar aulas de canto com as crianças. Ajudando elas durante o processo de tratamento.
        Realizar aulas de canto com as crianças. Ajudando elas durante o processo de tratamento.
        Realizar aulas de canto com as crianças. Ajudando elas durante o processo de tratamento.
        Realizar aulas de canto com as crianças. Ajudando elas durante o processo de tratamento.
        Realizar aulas de canto com as crianças. Ajudando elas durante o processo de tratamento
        </Text>
      </View>

      <View style={[styles.projeto, { marginTop: 30 }]}>
      <Text style={[styles.projetoTipo, { marginTop: 0 }]}>Data de Início no Projeto:</Text>
      <Text style={styles.projetoNome}>10/03/2020</Text>

      <Text style={styles.projetoTipo}>Data de Sáida do Projeto:</Text>
      <Text style={styles.projetoNome}>Ainda é Voluntário</Text>

      </View>

    </View>
  )
}
